import React from "react";
import RingImage from "../styles/bt.png";
import { Container, SignupFormContainer, Title } from "../styles/SignupStyle";

const Home = () => {

    const tabImageStyle = {
        width: '80%',
        height: '80%',
        margin: '7px'
      };

    const handleRingImageClick = () => {
        window.location.href = "./ring";
      };
  return (
    <Container>
      <SignupFormContainer>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <Title>안녕하세요, OOO님의 오늘의</Title>
          <img
            src={RingImage}
            alt="Ring"
            style={{ width: '30px', height: 'auto', marginLeft: '10px' }}
            onClick={handleRingImageClick}
          />
          <Title>목표 활동량은 0%입니다.</Title>
        </div>
      </SignupFormContainer>
    </Container>
  );
};

export default Home;
